import React from 'react';
import author1 from './resource/author1.jpeg';
import author2 from './resource/author2.jpeg';
import author3 from './resource/author3.jpeg';
import author4 from './resource/author4.jpeg';
import author5 from './resource/author5.jpeg';
import author6 from './resource/author6.jpeg';
import { Image } from 'react-bootstrap';
import Figure from 'react-bootstrap/Figure';


export default function ImageHolder(props) {
    function returnImage() {
        let image = '';
        console.log('image author ', props.author);
        switch (props.id) {
            case '1':
                image = <Figure>
                    <Figure.Image
                        width={400}
                        height={400}
                        alt="171x180"
                        src={author1}
                    />
                    <Figure.Caption>
                        {props.author.name + " in August 1987"}
                    </Figure.Caption>
                </Figure>;
                // image = <Image src={author1} rounded />
                break;
            case '2':
                image = <Image src={author2} rounded />
                break;
            case '3':
                image = <Image src={author3} rounded />
                break;
            case '4':
                image = <Image src={author4} rounded />
                break;
            case '5':
                image = <Image src={author5} rounded />
                break;
            case '6':
                image = <Image src={author6} rounded />
                break;
            default:
                image = <Image alt="Invisible man" rounded />

        }
        return image;
    }
    return (
        <div>
            {
                returnImage()
            }
        </div>
    );
}
